  \"2013-03-14T15:08:59.170894\",\n\t\"name\": \"2000-statewide-cir-geotiff-tiles\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Orthophotos combine the image characteristics
  of a photograph with the geometric qualities of a map. The primary digital orthophoto
  quadrangle (DOQ) is a 1-meter ground resolution, quarter-quadrangle (3.75 minutes
  of latitude by 3.75 minutes of longitude) image cast on the Universal Transverse
  Mercator projection (UTM) on the North American Datum of 1983 (NAD83). The geographic
  extent of the DOQ is equivalent to a quarter-quadrangle plus the over edge ranges
  from a minimum of 50 meters to a maximum of 300 meters beyond the extremes of the
  primary and secondary corner points. The over edge is included to facilitate tonal
  matching for mosaicing and for the placement of the NAD83 and secondary datum corner
  ticks. The normal orientation of data is by lines (rows) and samples (columns).
  Each line contains a series of pixels ordered from west to east with the order of
  the lines from north to south. This series of DOQs was produced as a part of the
  Arkansas Digital Orthophotography Program headed by the Arkansas State Land Information
  Board and the Arkansas Geographic Information Office. The aerial photography used
  to create the digital images was flown between January 15th and March 31st during
  2000-2002. The images make use of three separate spectral bands to form a color
  infrared composite, which allows easier analysis of agriculture, land use, vegetation,
  and other features with infrared reflectance. Areas of high vegetative vigor appear
  bright red in color infrared imagery.\",\n\t\"license_title\": null,\n\t\"extras\":
